import React, { Component } from 'react';
import './Dice.css';

class Dice extends Component {
  constructor(props) {
    super(props);
    this.state = {
      num: 1,
      num2: 2
    };
  }

  render() {
    return (
      <div className="container">
        <i className={`fas fa-dice-${this.state.num}`}></i>
        <i className="fas fa-dice-two"></i>
      </div>
    );
  }
}
export default Dice;
